import styles from "../css/Home.module.css"
import Card from '../components/Card';
import Login from "../components/Login";
import ShortCut from "../components/ShortCut";
import GenerateCsv from "../components/GenerateCsv";

const Home = () => {
  const totalCard = [
    {id:1,title: "login",children: <Login></Login>},
    {id:2,title: "shortcut-website", children:<ShortCut></ShortCut>},
    {id:3,title: "generate-csv",children:<GenerateCsv></GenerateCsv>},
    {id:4,title: "generate-random-keyword",children:<RandomKeyword></RandomKeyword>},
    {id:5,title: ""},
    {id:6,title: ""},
    {id:7,title: ""},
    {id:8,title: ""},
    {id:9,title: ""},
  ]
  return (
    <div className={styles.cardSection}>
      {totalCard.map((it, idx) => {
        return <Card key={idx} id={it.title}>{it.children}</Card>
      })}
    </div>
  )
}

export default Home
